@KwikWarren About what? You don't think there was interference at the postal service by DeJoy? You don't think it's possible any voting machines were hacked?
I'm not in the business of "kidding myself" 
Investigations, 12 years now. But thanks for the shade.

@BowYourHeadsLow Why does Shade have to be so /hot/?? Damn—

Rio did notice the joking tone, along with that sexy smirk and chuckle! Is she blushing...?

“I’m /YOUR/ loser~”
